import React, { Component } from 'react'

class Binary extends Component {
    render() {
        const ar=[3,5,6,8,9,10];
        const ui=ar.map(x=>{
            <div>x</div>
        });
        return (
            <div>
                {ui}
            </div>
        )
    }
}

export default Binary
